import React from 'react';
import logo from './logo.svg';
import './App.css';
import Starwars from './Starwars'
import Searchbar from './Searchbar'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Searchbar />
        <Starwars />
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
